// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "./Treatment.sol";
import "./TreatmentFactory.sol";

struct DoctorTreatmentMeta {
    address id;
    address patient;
    string medicine;
    bool completed;
}

struct DoctorStruct {
    bytes32 name;
    bytes32 affiliate;
}

contract Doctor is AccessControl {
    bytes32 public constant DOCTOR_ROLE = keccak256("DOCTOR_ROLE");
    bytes32 public constant MANAGER_ROLE = keccak256("MANAGER_ROLE");

    bytes32 private name;
    bytes32 private affiliate;
    address[] private treatments;
    bool private init;

    constructor() {
        _setRoleAdmin(MANAGER_ROLE, DEFAULT_ADMIN_ROLE);
    }

    modifier canWrite() {
        hasWriteAccess();
        _;
    }

    function hasWriteAccess() public view {
        require(
            hasRole(MANAGER_ROLE, msg.sender) ||
                hasRole(DOCTOR_ROLE, msg.sender),
            "Need write access"
        );
    }

    function initialize(
        address owner_,
        address manager_,
        bytes32 name_,
        bytes32 affiliate_
    ) external {
        require(init == false, "Already initialized");
        _setupRole(DOCTOR_ROLE, owner_);
        _setupRole(MANAGER_ROLE, manager_);

        name = name_;
        affiliate = affiliate_;
        init = true;
    }

    function initializeFromApp(
        address owner_,
        address app_,
        address manager_,
        bytes32 name_,
        bytes32 affiliate_
    ) external {
        require(init == false, "Already initialized");
        _setupRole(DOCTOR_ROLE, owner_);
        _setupRole(MANAGER_ROLE, manager_);
        _setupRole(MANAGER_ROLE, app_);

        name = name_;
        affiliate = affiliate_;
        init = true;
    }

    function getInfo() public view returns (bytes32 name_, bytes32 affiliate_) {
        name_ = name;
        affiliate_ = affiliate;
    }

    function addTreatment(address treatment_) public canWrite {
        treatments.push(treatment_);
    }

    function getTreatments()
        external
        view
        returns (DoctorTreatmentMeta[] memory treatments_)
    {
        treatments_ = new DoctorTreatmentMeta[](treatments.length);
        for (uint256 i = 0; i < treatments.length; i++) {
            Treatment treatment = Treatment(treatments[i]);
            treatments_[i] = DoctorTreatmentMeta(
                treatments[i],
                treatment.getPatient(),
                treatment.getMedicine(),
                treatment.isComplete()
            );
        }
    }
}
